g2:c.PROCEDURE.g2:a.TEXT:
whenever-item-that-is-part-of-receives-a-value-test(node: class benchmark-node)
status : truth-value;
status-text : text;
begin
    status, status-text = call whenever-item-that-is-part-of-receives-a-value-test-inner();
    if status then 
        call fail(node, status-text)
    else 
        call pass(node); 
end

whenever-item-that-is-part-of-receives-a-value-test-inner() = (truth-value, text)
status : truth-value;
status-text : text; 
begin
conclude that count-of-rule-executions = 0; 
conclude that the cof-density-cor of the fp-administrator of GE-1 = 1;
wait for 1 second;  // wait for rule to work
if count-of-rule-executions /= 1 then
    return true, "rule didn't fire after concluding that the cof-density-cor of the fp-administrator of GE-1 = 1";
conclude that the cof-density-cor of the fp-administrator of GE-1 = 5;
wait for 1 second;  // wait for rule to work
if count-of-rule-executions /= 2 then
    return true, "rule didn't fire after concluding that the cof-density-cor of the fp-administrator of GE-1 = 5"; 
conclude that the cof-density-cor of the fp-administrator of GE-1 = 5;
wait for 1 second;  // wait for rule to work
if count-of-rule-executions /= 3 then
    return true, "rule didn't fire after second concluding that the cof-density-cor of the fp-administrator of GE-1 = 5"; 
return false, "";
end

test-1234 ()

ts, t: quantity;

begin
    conclude that var-1 = 0;
    allow other processing;
    conclude that var-2 = 0;

    ts = the current subsecond real time; 
    repeat
        t = the current subsecond real time;
        exit if t > ts + 10 seconds;
        conclude that var-1 = var-1 + 1;
        allow other processing;
    end;

    post "[var-1] allow other processing statements. [var-2] rule triggers (1 every [10 / var-2] seconds).";

end

