status : truth-value;
status-text : text;
begin
    status,status-text = call priority-1-rules-vs-allow-other-processing-test-inner();
    if status then 
        call fail(node,status-text)
    else
        call pass(node);
end

{ true if lists are of the same length and contain the same elements in terms of "=" } 
compare-lists-as-sets( l1 : class g2-list, l2 : class g2-list) = ( truth-value )
s1 : sequence;
s2 : sequence;
result : truth-value ;
begin
s1 = the g2-list-sequence of l1;
s2 = the g2-list-sequence of l2;
result = call grtl-are-sequences-identical (s1,s2);
return result; 
end

gensymcid-1886--rule-ws-workspace-test-inner() = (truth-value, text)
status : truth-value;
status-text : text; 
bb : truth-value; 
begin
    call g2-run-inspect-command("recompile every rule");
    conclude that Q1 = 0;
    conclude that Q2 = 0;
    wait for 1 second; // let rules fire

    // check Q1    
    conclude that the g2-list-sequence of rules-that-fired = sequence();
    wait for 1 second; 
    conclude that Q1 = 1; 
    wait for 1 second; // let rules fire
    bb = call compare-lists-as-sets(rules-that-fired, rules-that-should-fire);
    if not (bb) then 
        return true, "expected that [the g2-list-sequence of rules-that-should-fire] would fire after change to Q1, but [the g2-list-sequence of rules-that-fired] fired instead";
    
    // check Q2 (copy-paste)
    conclude that the g2-list-sequence of rules-that-fired = sequence();
    wait for 1 second; 
    conclude that Q2 = 2; 
    wait for 1 second; // let rules fire
    bb = call compare-lists-as-sets(rules-that-fired, rules-that-should-fire);
    if not (bb) then 
        return true, "expected that [the g2-list-sequence of rules-that-should-fire] would fire after change to Q2, but [the g2-list-sequence of rules-that-fired] fired instead";
        
    return false, "";
end

gensymcid-1886--rule-ws-workspace-test (node : class benchmark-node )
status : truth-value;
status-text : text;
begin
status, status-text = call gensymcid-1886--rule-ws-workspace-test-inner();
if status then
    call fail(node, status-text)
else
    call pass(node);
end
